  false,\n\t\"url\": null,\n\t\"notes\": \"Parker River Refuge is currently developing
  a Habitat Management Plan, and expects a final HMP by fall of 2005. The Refuge finalized
  a master plan in 1986; however, much of the wildlife goals and objectives from that
  planning effort are out of date. Current habitat management programs implemented
  on the Refuge are continuations of historic practices (impoundment and grassland
  management) or have been opportunistic (salt marsh restoration and invasive plant
  control). Management strategies are outlined for each habitat management objective.\",\n\t\"owner_org\":
